import React from "react";
import axios from "axios";
class About extends React.Component {

    constructor() {
        super();
        this.funDisplay = this.funDisplay.bind(this);
        this.funDisplay();
        this.state = {
            data: ''
        }
    }

    funDisplay() {
        try {
            axios.get("http://localhost:3001/users/display")
                .then(res => this.setState({ data: res.data }));
        } catch (error) {
            console.log(error);
        }
    }
    render() {
        return (
            <div className="about" >
                <div class="container">
                    <div class="row align-items-center my-5">
                        {this.data.map((user) => (
                            <div class="alert alert-danger" key={Math.random()} role="alert">
                                {user}
                            </div>
                        ))}
                    </div>
                </div>
            </div>
        );
    }
}

export default About;
